ågældende kapitel på deres websted. Endvidere kan facilitatorer benytte søgninger fra SHEBANQ\n    til at generere øvelser i Bible OL.</p>\n\n    <p>Kildeteksten til Bible OL er tilgængelig på <a href=\"https://github.com/EzerIT/BibleOL\"\n    target=\"_blank\">GitHub</a>. Vi håber at udviklere vil fork\'e denne kode og hjælpe os med at\n    tilføje nye faciliteter.</p>'),(460,'intro_text','intro_right1','<p>Siden 2014 har Bible Online Learner være en del af <a href=\"http://global-learning.org\"\n    target=\"_blank\">Global Learning Initiative</a>. Yderligere oplysnigner fås hos professor Nicolai\n    Winther-Nielsen (nwn [at] dbi . edu) hos <a href=\"http://fih.fjellhaug.no\"\n    target=\"_blank\">Fjellhaug International University College Denmark (FIUC-DK)</a>.<br>\n\n    Bible Online Learner blev udviklet af Claus Tøndering fra <a href=\"http://www.ezer.dk\"\n    target=\"_blank\">Ezer IT Consulting</a>.<br>\n\n    For sit PhD-studium ved Aalborg universitet udvikler Judith Gottschalk <i>Learning Journey,</i>\n    en plugin som giver statistiske oplysninger om\n    hvorledes studerende klarer sig i Bible OL.</p>'),(461,'intro_text','intro_right2','<p>Bible Online Learner er baseret på PLOTLearner, et PC-program der blev udklet som en del af <a\n    href=\"http://www.eplot.eu\" target=\"_blank\">EuroPLOT-projektet</a> i 2010-2013. Nærværende\n    websted er resultatet af videre udvikling foretaget af Ezer IT Consulting uden for\n    EuroPLOT-projektet. Webstedet vedligeholdes af <a href=\"http://3bmoodle.dk\" target=\"_blank\">3BM\n    Bible Software and Multimedia</a>.</p>'),(462,'intro_text','intro_right3','<p>SHEBANQ-webstedet blev skabt af Wido van Peursen og Dirk Roorda.</p>'),(463,'intro_text','intro_right_head','Bible Online Learner &ndash; fri global læring'),(464,'intro_text','welcome','Velkommen til Bible Online Learner'),(465,'intro_text','welcome2','%s, velkommen til Bible Online Learner'),(466,'privacy','privacy_policy_title','Privatlivspolitik'),(467,'privacy','privacy_text','<h1>Privatlivspolitik</h1>\n\n     <p>Denne privatlivspolitik fastlægger hvordan Bible Online Learner benytter og beskytter de oplysninger\n     som du angiver når du bliver registreret på dette websted.</p>\n\n     <p>Du kan bruge visse funktioner på dette websted uden at registrere dig. I så fald indsamler vi ingen\n     personlige oplysninger om dig.</p>\n\n     <h2>Hvad indsamler vi?</h2>\n     <p>Hvis du får en konto på dette websted, indsamle vi følgende oplysninger:</p>\n\n     <ul>\n       <li>Navn</li>\n       <li>Email-adresse</li>\n     </ul>\n\n     <p>Disse oplysninger benyttes udenlukkede for at</p>\n     <ul>\n       <li>identificere dig når du benytter webstedet,</li>\n       <li>om nødvendigt sende dig emails om webstedets tilstand.</li>\n     </ul>\n\n     <p>Vi videregiver ikke dine oplysninger til tredjepart til brug for markedsføring eller reklame,\n     og vi sælger ikke dine oplysninger.</p>\n\n     <h2>Hvordan sletter du din konto?</h2>\n\n     <p>Du kan slette din konto på dette websted ved at vælge menupunktet »Profil« under »Mine data«\n     og derpå klikke på knappen »Nedlæg profilen«. Dette vil fjerne alle oplysninger om dit navn og din\n     email-adresse fra dette websted.</p>\n\n     <h2>Links til andre websteder</h2>\n\n     <p>Vores websted kan indeholde links der gør det let for dig at besøge andre interessante websteder.\n     Men så snart et sådant link har ført dig væk fra vores websted, skal du være opmærksom på at vi ikke\n     har nogen kontrol over det andet websted. Vi er derfor ikke ansvarlige for hvad der sker hvis du\n     dér giver private oplysninger, og sådanne websteder er ikke underlagt nærværende privatlivspolitik.\n     Du bør være forsigtig og undersøge hvilke privatlivsregler der gælder for disse andre websteder.</p>'),(468,'common','already_logged_in','Du er allerede logget ind'),(469,'common','cancel_button','Annullér'),(470,'common','cannot_open_file','Kan ikke åbne filen: %s'),(