ara ir directamente al mismo capítulo en su sitio web. Además,\n       facilitadores puede usar desde SHEBANQ para generar ejercicios en Bible OL.</p>\n\n       <p>La fuente de código para Bible OL está disponible en <a href=\"https://github.com/EzerIT/BibleOL\"\n       target=\"_blank\">GitHub</a>. Esperamos que programadores puedan trabajar con este código y se unan a nosotros para adicionar\n       características adicionales.</p>'),(451,'intro_text','intro_right1','<p>Desde el 2014, Bible Online Learner ha sido parte de <a href=\"http://global-learning.org\"\n       target=\"_blank\">Global Learning Initiative</a>. Para más información, por favor contacte Profesor\n       Nicolai Winther-Nielsen (nwn [at] dbi . edu) de <a\n       href=\"http://fih.fjellhaug.no\" target=\"_blank\">Fjellhaug International\n       University College Denmark (FIUC-DK)</a>.<br>\n\n       Bible Online Learner fue desarrollado por Claus Tøndering of <a href=\"http://www.ezer.dk\"\n       target=\"_blank\">Ezer IT Consulting</a>.<br>\n\n       Para su Doctorado en Aalborg University, Judith Gottschalk está desarrollando <i>Learning Journey,</i>\n       una adición con estadísticas en el rendimiento del estudiante.</p>'),(452,'intro_text','intro_right2','<p>Bible Online Learner está basado en PLOTLearner, un programa de desarrollado como parte del proyecto\n       <a href=\"http://www.eplot.eu\" target=\"_blank\">EuroPLOT</a> 2010-2013. El\n       presente sitio web es el resultado de major desarrollo por Ezer IT Consulting fuera del proyecto\n       EuroPLOT, y el sitio web es mantenido por <a href=\"http://3bmoodle.dk\"\n       target=\"_blank\">3BM Bible Software and Multimedia</a>.</p>'),(453,'intro_text','intro_right3','<p>El sitio web SHEBANQ fue creado por Wido van Peursen and Dirk Roorda.</p>'),(454,'intro_text','intro_right_head','Bible Online Learner para un Aprendizaje Global Gratuito'),(455,'intro_text','welcome','Bienvenido Bible Online Learner'),(456,'intro_text','welcome2','%s, bienvenido a Bible Online Learner'),(457,'privacy','privacy_policy_title','Póliza de Privacidad'),(458,'privacy','privacy_text','<h1>Póliza de Privacidad</h1>\n\n     <p>Esta póliza de privacidad establece como Bible Online Learner usa and proteje cualquier información que tú\n     provees cuando te registras en este sitio web.</p>\n\n     <p>Usted puede usar algunas funciones en este sitio web sin tener que registrarse. En ese caso, no colectamos\n     información personal acerca de tí.</p>\n\n\n     <h2>Que colectamos</h2>\n     <p>Si estableces una cuenta en este sitio web, puede que colectemos la siguiente información:</p>\n\n     <ul>\n       <li>Nombre</li>\n       <li>Correo Electrónico</li>\n     </ul>\n\n     <p>Esta información es usada solamente para el próposito de</p>\n     <ul>\n       <li>identificarte cuando usas el sitio web,</li>\n       <li>si es necesario, enviarte correo electrónicos acerca del estado de este sitio web.</li>\n     </ul>\n\n     <p>No proporcionaremos tu información a terceras personas para venta o própositos promocionales, ni\n     venderemos tu información.</p>\n\n     <h2>Eliminar tu cuenta</h2>\n\n     <p>Usted puede eliminar su cuenta en este sitio web seleccionando el menú “Perfil” del \n     menú “Mi información” y luego haga click al botón etiquetado “Eliminar el perfil.” Esto removerá toda\n     información acerca de tu nombre y correo electrónico en este sitio web.</p>\n\n     <h2>Enlaces a otros sitios web.</h2>\n\n     <p>Nuestro sitio web contiene enlaces te ayudan a visitar otros sitios web de fácil interés. Sin embargo,\n     una vez que hayas usado estos enlaces para abandonar nuestro sitio, usted debe notar que no tenemos control\n     sobre ese otro sitio web. Por lo tanto, no podemos ser responsable por la protección y privacidad de la\n     información que provees mientras visitas tales sitios and esos sitios no estan governados por esta \n     declaración de privacidad. Usted debe de ejercitar cuidado y leer la declaración de privacidad aplicable al\n     sitio web en pregunta.</p>'),(459,'common','already_logged_in','Usted ya ha iniciado sesión'),(460,'common','cancel_button','Cancelar'),(461,'common','cannot_open_file','No se puede abrir el archivo: %s'),(462,'common','close_button','Cerrar'),(463,'common','date_time_format','d M A H:i'),(464,'common','error_colon','Error:'),(465,'common','facebook_no_valid_reply','Respuesta no válida de Facebook'),(466,'common','field_required','(Requerido)'),(467,'common','google_no_valid_reply','Respuesta no válida de Google'),(468,'common','illegal_class_id','Identificación de clase ilegal'),(469,'common','illegal_user_id','Identificación de usuario ilegal'),(470,'common','language','Lenguaje'),(471,'common','missing_folder_name','Falta el nombre de carpeta'),(472,'common','missing_quiz_filename','Falta el nombre de archivo de test'),(473,'common','must_be_admin','Debe de iniciar sesión como administrador para acceder a esta función'),(474,'common','must_be_facebook','Debe de iniciar sesión con Facebook para acceder a esta función'),(475,'common','must_be_google','Debe de iniciar sesión con Google para acceder a esta función'),(476,'common','must_be_logged_in','Debe de iniciar sesión para acceder a esta función'),(477,'common','must_be_teacher','Debe de iniciar sesión como facilitador para acceder a esta función'),(478,'common','must_not_be_facebook','No debe de iniciar sesión con Facebook para acceder a esta función'),(479,'common','must_not_be_google','No debe de iniciar sesión con Google para acceder a esta función'),(480,'common','no','No'),(481,'common','OK_button','Aceptar'),(482,'common','swipe','Si la pantalla no es lo suficiente amplia como para mostrar una columna completa en la tabla, puedes deslizar cada columna izquierda y derecha.'),(483,'common','this_is_folder','Esta es la carpeta \'%s\''),(484,'common','this_is_top_folder','Esta es la Primera Carpeta'),(485,'common','time_format','H:i'),(486,'common','yes','