ss links'),(439,'menu','my_data','Minhas Informações'),(440,'menu','privacy_policy','Política de Privacidade'),(441,'menu','profile','Perfil'),(442,'menu','statistics','Estatísticas'),(443,'menu','text_and_exercises','Texto e Exercícios'),(444,'menu','users','Usuários'),(445,'menu','user_access','Acesso de usuário'),(446,'intro_text','intro_center','<h1>O que é o Bible Online Learner?</h1>\n\n      <p>Bible Online Learner (Bible OL) dá liver aces so à Bíblia Hebraica na database ETCBC4\n       e ao text grego do Novo Testamento da versão de 1904 de Nestle com anotações gramaticais;\n       ademais, professors podem user os exercícios desenvolvidos para o Bible OL ou criar os seus próprios exercícios.</p>\n\n       <p>Bible OL está inter-conectado ao premiado website de testes em Hebraico e de exibição de texto <a\n       href=\"http://shebanq.ancient-data.org\" target=\"shebanq\">SHEBANQ</a>. A partir de um capítulo no website Bible\n       OL, clique no logo do SHEBANQ para ser redirecionado diretamente para o mesmo capítulo neste website. Ademais,\n       professores podem usar perguntas criadas no website SHEBANQ para gerar exercícios no Bible OL.</p>\n\n       <p>O código-fonte para o Bible OL está disponível em <a href=\"https://github.com/EzerIT/BibleOL\"\n       target=\"_blank\">GitHub</a>. Nosso desejo é que outros programadores trabalhem com este código e se juntem a nós para desenvolver\n       características adicionais.</p>'),(447,'intro_text','intro_right1','<p>Desde 2014, o Bible Online Learner é parte do <a href=\"http://global-learning.org\"\n       target=\"_blank\">Global Learning Initiative</a>. Para mais informações, por favor faça contato com o Professor\n       Nicolai Winther-Nielsen (nwn [at] dbi . edu) de <a\n       href=\"http://fih.fjellhaug.no\" target=\"_blank\">Fjellhaug International\n       University College Denmark (FIUC-DK)</a>.<br>\n             \n       Bible Online Learner foi desenvolvido por Claus Tøndering de <a href=\"http://www.ezer.dk\"\n       target=\"_blank\">Ezer IT Consulting</a>.<br>\n\n       Para seu PhD em Aalborg University, Judith Gottschalk está desenvolvendo <i>Learning Journey,</i>\n       um plugin com estatísticas sobre performance de aprendizado.</p>'),(448,'intro_text','intro_right2','<p>Bible Online Learner é baseado em PLOTLearner, um programa de PC desenvolvido como parte do projeto\n       <a href=\"http://www.eplot.eu\" target=\"_blank\">EuroPLOT</a>, 2010-2013. O\n       presente website é resultado de desenvolvimento posterior feito por Ezer IT Consulting fora do projeto\n       EuroPLOT, e o site é mantido por <a href=\"http://3bmoodle.dk\"\n       target=\"_blank\">3BM Bible Software and Multimedia</a>.</p>'),(449,'intro_text','intro_right3','<p>O website SHEBANQ foi criado por Wido van Peursen e Dirk Roorda.</p>'),(450,'intro_text','intro_right_head','Bible Online Learner por um movimento global de aprendizado gratuito'),(451,'intro_text','welcome','Bem-vindo ao Bible Online Learner'),(452,'intro_text','welcome2','%s, bem-vindo ao Bible Online Learner'),(453,'privacy','privacy_policy_title','Política de Privacidade'),(454,'privacy','privacy_text','<h1>Política de Privacidade</h1>\n\n     <p>Essa política de privacidade delimita como o Bible Online Learner usa e protege qualquer informação que você \n     provê quando se registra neste website.</p>\n\n     <p>Você pode usar algumas funções deste website sem se registrar. Neste caso, nós não coletamos\n     qualquer informação pessoal sua.</p>\n\n\n     <h2>Aquilo que nós coletamos</h2>\n     <p>Se você fizer uma conta neste website, nós poderemos coletar as seguintes informações:</p>\n\n     <ul>\n       <li>Nome</li>\n       <li>Endereço de email</li>\n     </ul>\n\n     <p>Essa informação é somente usada para</p>\n     <ul>\n       <li>identificar você quando você usar o website,</li>\n       <li>se necessário, enviá-lo emails sobre o status deste website.</li>\n     </ul>\n\n     <p>Nós não forneceremos suas informações à uma terceira parte para usálas em marketing ou propósitos promocionais. Nós\n     não venderemos as suas informações.</p>\n\n     <h2>Deletando sua conta</h2>\n\n     <p>Você pode deletar sua conta neste website ao selecionar o item de menu “Perfil” no\n     menu “Minhas Informações” e então clicar no botão “Deletar o Perfil.” Isso removerá todas as \n     informações sobre o seu nome e endereço de email deste website.</p>\n\n     <h2>Links para outros websites</h2>\n\n     <p>Nosso website pode conter links para habilitá-lo à visitar outros websites de interesse facilmente. Contudo,\n     uma vez que você utilizar esses links para deixar nosso site, você deveria notar que nós não temos nenhum controle\n     sobre outros websites. Portanto, nós não podemos ser responsáveis pela proteção e privacidade de nenhuma informação\n     que você fornecer enquanto estiver visitando tais sites. Ademais, estes sites não são governados por esta\n     declaração de privacidade. Você deve exercer cautela e checar a de claração de privacidade aplicável ao\n     website em questão.</p>'),(455,'common','already_logged_in','Você já está logado'),(456,'common','cancel_button','Cancelar'),(457,'common','cannot_open_file','O arquivo %s não pode ser aberto'),(458,'common','close_button','Fechar'),(459,'common','date_time_format','d M Y H:i'),(460,'common','error_colon','Erro:'),(461,'common','facebook_no_valid_reply','Resposta inválida do Facebook'),(462,'common','field_required','(Necessário)'),(463,'common','google_no_valid_reply','Nenhuma resposta válida do Google'),(464,'common','illegal_class_id','Identificação de Classe Ilegal'),(465,'common','illegal_user_id','Identificação de Usuário Ilegal'),(466,'common','language','Língua'),(467,'common','missing_folder_name','Nome da pasta faltando'),(468,'common','missing_quiz_filename','Nome de arquivo do quiz faltando'),(469,'common','must_be_admin','Você precisa entrar como administrador para acessar esta função'),(470,