8,'menu','display_text','显示经文'),(439,'menu','enroll_in_class','报名加入班别'),(440,'menu','exercises','练习'),(441,'menu','font_preferences','字型选择'),(442,'menu','home','首页'),(443,'menu','login','登入'),(444,'menu','logout','登出'),(445,'menu','manage_exercises','管理练习'),(446,'menu','manage_gloss_links','词语解释的链结'),(447,'menu','my_data','我的资料'),(448,'menu','privacy_policy','私隐政策'),(449,'menu','profile','账户资料'),(450,'menu','statistics','成绩'),(451,'menu','text_and_exercises','经文和练习'),(452,'menu','users','使用者'),(453,'menu','user_access','登入'),(454,'intro_text','intro_center','<h1>什么是原文读经练习网？</h1>\r\n\r\n      <p>原文读经练习网让您免费阅读希伯来文圣经和希腊文新约圣经，两者都逐个词附有语法资料。此外，教师可以使用原文读经练习网里已有的练习来给学生，或者自制练习给学生。希伯来文圣经的版本是荷兰阿姆斯特丹自由大学（Vrije Universiteit Amsterdam）泰斯查圣经与电脑中心（Eep Talstra Centre for Bible and Computer）ETCBC4资料库里的版本。希腊文新约圣经的版本是奈瑟勒（Nestle）1904年版。</p>\r\n\r\n       <p>原文读经练习网连结于<a\r\n       href=\"http://shebanq.ancient-data.org\" target=\"shebanq\">SHEBANQ</a>，这是一个搜寻和显示希伯来经文的优秀网站，曾经获奖。在原文读经练习网里阅读某一章经文的时候，您可以按SHEBANQ的标志，造访他们网站的同一章经文。还有，助教可以用SHEBANQ的搜寻功能来在原文读经练习网里制作练习。\r\n</p>\r\n\r\n       <p>原文读经练习网的程式码，可以在以下网页看到：<a href=\"https://github.com/EzerIT/BibleOL\"\r\n       target=\"_blank\">GitHub</a>.我们盼望会有程式开发员使用这套程式码，和我们合作，加入更多功能。\r\n</p>'),(455,'intro_text','intro_right1','<p>原文读经练习网是<a href=\"http://global-learning.org\"\r\n       target=\"_blank\">全球学习计划（Global Learning Initiative）</a>的一个环节，2014年启用。如果想要知道详情，请联络<a\r\n       href=\"http://fih.fjellhaug.no\" target=\"_blank\">丰贺国际大学丹麦校园（Fjellhaug International\r\n       University College Denmark (FIUC-DK)）</a>.<br>的温德生教授（Nicolai Winther-Nielsen，nwn [at] dbi . edu）。\r\n</a>.<br>\r\n\r\n       原文读经练习网的程式，由<a href=\"http://www.ezer.dk\"\r\n       target=\"_blank\">以思资讯科技顾问公司（Ezer IT Consulting）</a>.<br>的滕德令（Claus Tøndering）开发。\r\n</a>.<br>\r\n\r\n       奥尔堡大学（Aalborg University）博士生葛淑（Judith Gottschalk）正在研发<i>学习旅程</i>，这是一个外挂程式，统计学生的成绩。</p>'),(456,'intro_text','intro_right2','<p>原文读经练习网以个人电脑（PC）软件PLOTLearner为基础，这个软件属于<a href=\"http://www.eplot.eu\" target=\"_blank\">欧盟利导式教学软件开发计划（EuroPLOT）</a>（2010至2013年）。本网站由以思资讯科技顾问公司据之进一步开发而成，不属于欧盟诱导式教学软件开发计划。<a href=\"http://3bmoodle.dk\"\r\n       target=\"_blank\">3BM Bible Software and Multimedia</a>负责管理这个网站。\r\n</p>'),(457,'intro_text','intro_right3','<p>SHEBANQ网站由裴尔森（Wido van Peursen）和罗珥德（Dirk Roorda）建立。</p>'),(458,'intro_text','intro_right_head','原文读经练习网，免费辅助全球学生学习！'),(459,'intro_text','welcome','欢迎光临原文读经练习网！'),(460,'intro_text','welcome2','%s，欢迎光临原文读经练习网！'),(461,'privacy','privacy_policy_title','私隐政策'),(462,'privacy','privacy_text','<h1>私隐政策</h1>\r\n\r\n     <p>这篇私隐政策说明原文读经练习网怎样使用和保护您在本网站建立账户时提交的资料。</p>\r\n\r\n     <p>本网站的一些功能，您不建立账户也可以使用。在这个情况下，我们不搜集您的任何个人资料。</p>\r\n\r\n\r\n     <h2>我们收集什么资料</h2>\r\n     <p>如果您在本网站建立账户，我们就可能收集以下资料：</p>\r\n\r\n     <ul>\r\n       <li>姓名</li>\r\n       <li>电邮地址</li>\r\n     </ul>\r\n\r\n     <p>这些资料只用于：</p>\r\n     <ul>\r\n       <li>您使用本网站时，确定您的身分；</li>\r\n       <li>有需要时寄电邮通知您本网站的情况。</li>\r\n     </ul>\r\n\r\n     <p>我们不会把您的资料提供给第三者作行销或业务推广之用，也不会出售您的资料。</p>\r\n\r\n     <h2>删除账户</h2>\r\n\r\n     <p>您可以删除您在这个网站的账户，方法是按“我的资料”，再按其中的“账户资料”，然后按“删除账户”。这样做就会由这个网站删除您姓名和电邮地址的所有资料。</p>\r\n\r\n     <h2>其他网站的链结</h2>\r\n\r\n     <p>这个网站里可能有一些链结，让您轻易造访其他有用的网站。不过，您一旦按那些链结而离开这个网站，您必须知道我们对那些网站没有任何控制权。因此当您造访那些网站时，我们并不负责保护您提供的任何资料，也不负责把您的资料保密。那些网站不受本私隐政策声明约束。您应当小心，阅读所造访网站的私隐政策。</p>'),(463,'common','already_logged_in','您已经登入'),(464,'common','cancel_button','取消'),(465,'common','cannot_open_file','无法打开档案%s'),(466,'common','close_button','关闭'),(467,'common','date_time_format','某年某月某日某时:某分'),(468,'common','error_colon','错误：'),(469,'common','facebook_no_valid_reply','Facebook的回应不正确'),(470,'common','field_required','（必须填写）'),(471,'common','google_no_valid_reply','Google的回应不正确'),(472,'common','illegal_class_id','班别名称错误'),(473,'common','illegal_user_id','使用者名称错误'),(474,'common','language','语言'),(475,'common','missing_folder_name','欠资料夹名称'),(476,'common','missing_quiz_filename','欠练习档案名称'),(477,'common','must_be_admin','您必须以管理员身分登入，才能使用这个功能。'),(478,'common','must_b