u','classes','班別'),(438,'menu','display_text','顯示經文'),(439,'menu','enroll_in_class','報名加入班別'),(440,'menu','exercises','練習'),(441,'menu','font_preferences','字型選擇'),(442,'menu','home','首頁'),(443,'menu','login','登入'),(444,'menu','logout','登出'),(445,'menu','manage_exercises','管理練習'),(446,'menu','manage_gloss_links','詞語解釋的鏈結'),(447,'menu','my_data','我的資料'),(448,'menu','privacy_policy','私隱政策'),(449,'menu','profile','帳戶資料'),(450,'menu','statistics','成績'),(451,'menu','text_and_exercises','經文和練習'),(452,'menu','users','使用者'),(453,'menu','user_access','登入'),(454,'intro_text','intro_center','<h1>甚麼是原文讀經練習網？</h1>\r\n\r\n      <p>原文讀經練習網讓您免費閱讀希伯來文聖經和希臘文新約聖經，兩者都逐個詞附有語法資料。此外，教師可以使用原文讀經練習網裡已有的練習來給學生，或者自製練習給學生。希伯來文聖經的版本是荷蘭阿姆斯特丹自由大學（Vrije Universiteit Amsterdam）泰斯查聖經與電腦中心（Eep Talstra Centre for Bible and Computer）ETCBC4資料庫裡的版本。希臘文新約聖經的版本是奈瑟勒（Nestle）1904年版。</p>\r\n\r\n       <p>原文讀經練習網連結於<a\r\n       href=\"http://shebanq.ancient-data.org\" target=\"shebanq\">SHEBANQ</a>，這是一個搜尋和顯示希伯來經文的優秀網站，曾經獲獎。在原文讀經練習網裡閱讀某一章經文的時候，您可以按SHEBANQ的標誌，造訪他們網站的同一章經文。還有，助教可以用SHEBANQ的搜尋功能來在原文讀經練習網裡製作練習。\r\n\r\n</p>\r\n\r\n       <p>原文讀經練習網的程式碼，可以在以下網頁看到：<a href=\"https://github.com/EzerIT/BibleOL\"\r\n       target=\"_blank\">GitHub</a>.我們盼望會有程式開發員使用這套程式碼，和我們合作，加入更多功能。\r\n</p>'),(455,'intro_text','intro_right1','<p>原文讀經練習網是<a href=\"http://global-learning.org\"\r\n       target=\"_blank\">全球學習計劃（Global Learning Initiative）</a>的一個環節，2014年啟用。如果想要知道詳情，請聯絡<a\r\n       href=\"http://fih.fjellhaug.no\" target=\"_blank\">豐賀國際大學丹麥校園（Fjellhaug International\r\n       University College Denmark (FIUC-DK)）</a>.<br>的溫德生教授（Nicolai Winther-Nielsen，nwn [at] dbi . edu）。\r\n</a>.<br>\r\n\r\n       原文讀經練習網的程式，由<a href=\"http://www.ezer.dk\"\r\n       target=\"_blank\">以思資訊科技顧問公司（Ezer IT Consulting）</a>.<br>的滕德令（Claus Tøndering）開發。\r\n</a>.<br>\r\n\r\n       奧爾堡大學（Aalborg University）博士生葛淑（Judith Gottschalk）正在研發<i>學習旅程</i>，這是一個外掛程式，統計學生的成績。</p>'),(456,'intro_text','intro_right2','<p>原文讀經練習網以個人電腦（PC）軟件PLOTLearner為基礎，這個軟件屬於<a href=\"http://www.eplot.eu\" target=\"_blank\">歐盟利導式教學軟件開發計劃（EuroPLOT）</a>（2010至2013年）。本網站由以思資訊科技顧問公司據之進一步開發而成，不屬於歐盟誘導式教學軟件開發計劃。<a href=\"http://3bmoodle.dk\"\r\n       target=\"_blank\">3BM Bible Software and Multimedia</a>負責管理這個網站。\r\n</p>'),(457,'intro_text','intro_right3','<p>SHEBANQ網站由裴爾森（Wido van Peursen）和羅珥德（Dirk Roorda）建立。</p>'),(458,'intro_text','intro_right_head','原文讀經練習網，免費輔助全球學生學習！'),(459,'intro_text','welcome','歡迎光臨原文讀經練習網！'),(460,'intro_text','welcome2','%s，歡迎光臨原文讀經練習網！'),(461,'privacy','privacy_policy_title','私隱政策'),(462,'privacy','privacy_text','<h1>私隱政策</h1>\r\n\r\n     <p>這篇私隱政策說明原文讀經練習網怎樣使用和保護您在本網站建立帳戶時提交的資料。</p>\r\n\r\n     <p>本網站的一些功能，您不建立帳戶也可以使用。在這個情況下，我們不蒐集您的任何個人資料。</p>\r\n\r\n\r\n     <h2>我們收集甚麼資料</h2>\r\n     <p>如果您在本網站建立帳戶，我們就可能收集以下資料：</p>\r\n\r\n     <ul>\r\n       <li>姓名</li>\r\n       <li>電郵地址</li>\r\n     </ul>\r\n\r\n     <p>這些資料只用於：</p>\r\n     <ul>\r\n       <li>您使用本網站時，確定您的身分；</li>\r\n       <li>有需要時寄電郵通知您本網站的情況。</li>\r\n     </ul>\r\n\r\n     <p>我們不會把您的資料提供給第三者作行銷或業務推廣之用，也不會出售您的資料。</p>\r\n\r\n     <h2>刪除帳戶</h2>\r\n\r\n     <p>您可以刪除您在這個網站的帳戶，方法是按“我的資料”，再按其中的“帳戶資料”，然後按“刪除帳戶”。這樣做就會由這個網站刪除您姓名和電郵地址的所有資料。</p>\r\n\r\n     <h2>其他網站的鏈結</h2>\r\n\r\n     <p>這個網站裡可能有一些鏈結，讓您輕易造訪其他有用的網站。不過，您一旦按那些鏈結而離開這個網站，您必須知道我們對那些網站沒有任何控制權。因此當您造訪那些網站時，我們並不負責保護您提供的任何資料，也不負責把您的資料保密。那些網站不受本私隱政策聲明約束。您應當小心，閱讀所造訪網站的私隱政策。</p>'),(463,'common','already_logged_in','您已經登入'),(464,'common','cancel_button','取消'),(465,'common','cannot_open_file','無法打開檔案%s'),(466,'common','close_button','關閉'),(467,'common','date_time_format','某年某月某日某時:某分'),(468,'common','error_colon','錯誤：'),(469,'common','facebook_no_valid_reply','Facebook的回應不正確'),(470,'common','field_required','（必須填寫）'),(471,'common','google_no_valid_reply','Google的回應不正確'),(472,'common','illegal_class_id','班別名稱錯誤'),(473,'common','illegal_user_id','使用者名稱錯誤'),(474,'common','language','語言'),(475,'common','missing_folder_name','欠資料夾名稱'),(476,'common','missing_quiz_filename','欠練習檔案名稱'),(477,'common','must_be_admin','您必須以管理員身分登入，才能使用這個功